import React from 'react'

export default function EmptyBlock({wordLength}:any) {
    let inputFields = '5';

    for (let i = 1; i <= wordLength; i++) {
      inputFields+= '5';
    }

  return (
    <div>
        {inputFields}
  </div>
  )
}
